import './Submit.css'
import { useHistory, Link } from "react-router-dom";

function Submit(props){
    const history = useHistory();
    function finalSubmit(event) {
        history.push("./Thanks");        
      }
  const userInfo = [];
  userInfo.push(props.personalInfo, props.skills, props.covid, props.insights);

//   console.log(props.personalInfo, props.skills, props.covid, props.insights)
  for (let i = 0; i < props.covid.length; i++) {
    if (props.covid[i] === "Y" || props.covid[i] === "Yes") {
      props.covid[i] = true;
    }
    if (props.covid === "No" || props.covid === "N") {
        props.covid = false;
    }
  }
  console.log(userInfo)

    return(
        <div className="box">
            <div className='submit'>
            <button onClick={finalSubmit}>Submit</button>
            <Link to={"./Insights"} style={{ textDecoration: "none" }}>
            <p>Go Back</p>
            </Link>
            </div>
        </div>
    )
}
export default Submit;
